    false,nt"url": null,nt"notes": "This narrative report for Mud Lake National
    Wildlife Refuge outlines Refuge accomplishments from May through August of 1948.
    The report begins by summarizing the weather conditions, water conditions, food
    and cover, and wildfires during this period. Wildlife- including migratory birds,
    big game animals, fur animals, predators, rodents, raptors, and fish- is also covered.
    The Refuge development and maintenance section discusses physical developments,
    plantings, and collections and receipts. Resource management is outlined; topics
    include grazing and haying. The public relations section discusses Refuge visitors,
    Refuge participation, and violations. Items of interest and N-R forms are attached.",nt"owner_org":
